svg.script:
var map = document.getElementById('svgMap');
var beforeX,
    beforeY,
    afterX,
    afterY;

var mouseIsDown = false;

function svgMouseDown(){
    mouseIsDown = true;
    beforeX = event.clientX;
    console.log('beforeX = ' + beforeX);
    beforeY = event.clientY;
    console.log('beforeY = ' + beforeY);
}

function svgMouseMove(){
    if (mouseIsDown == true)
    {
        var difX = beforeX - event.clientX;
        console.log('differentX is ' + difX);
        var difY = beforeY - event.clientY;
        console.log('differentY is ' + difY);

        map.viewBox.baseVal.x += difX;
        map.viewBox.baseVal.y += difY;

        beforeX = event.clientX;
        beforeY = event.clientY;
    }
}

function svgMouseUp(){
      mouseIsDown = false;  
}
